function getDateDifference(e){const a=new Date("21 May, 2006");let t=e-a,o=Math.floor(t/864e5),r=0,n=0;for(;o>=365;){let e=new Date(a.getFullYear()+n+1,0,0).getTime()-new Date(a.getFullYear()+n,0,0).getTime(),t=Math.floor(e/864e5);if(!(o>=t))break;n++,o-=t}for(;o>=30;){let e=new Date(a.getFullYear()+n,a.getMonth()+r+1,0).getDate();if(!(o>=e))break;r++,o-=e}return{days:o,months:r,years:n}}function playSound(e){audioThread1.paused?(audioThread1.src="/assets/"+e+".wav",audioThread1.play(),console.log("T1: Played.")):(audioThread2.src="/assets/"+e+".wav",audioThread2.play(),console.log("T2: Played."))}function sleep(e){return new Promise(a=>setTimeout(a,e))}const audioThread1=new Audio,audioThread2=new Audio;